import * as S from '../../styles/Routine/Routine.style';

function ExerciseCard({ id, type, part, name, exerciseCard, openCard }) {

  return (
    <S.ExerciseCard openCard={openCard}>
      <S.CardText>{type}/{part}</S.CardText>
      <S.CardMainText>{name}</S.CardMainText>
    </S.ExerciseCard> 
  )
}

export default ExerciseCard;
